			shellScript = "# Type a script or drag a script file from your workspace to insert its path.\n#!/bin/sh\n\n#要build的target名\n\nTARGET_NAME=${PROJECT_NAME}\n\nif [[ $1 ]]\n\nthen\n\nTARGET_NAME=$1\n\nfi\n\nUNIVERSAL_OUTPUT_FOLDER=\"${SRCROOT}/${PROJECT_NAME}/\"\n\n#创建输出目录，并删除之前的framework文件\n\nmkdir -p \"${UNIVERSAL_OUTPUT_FOLDER}\"\n\nrm -rf \"${UNIVERSAL_OUTPUT_FOLDER}/${TARGET_NAME}.xcframework\"\n\n#分别编译模拟器和真机的Framework\n\nxcodebuild -target \"${TARGET_NAME}\" ONLY_ACTIVE_ARCH=NO -configuration ${CONFIGURATION} -sdk iphoneos BUILD_DIR=\"${BUILD_DIR}\" BUILD_ROOT=\"${BUILD_ROOT}\" clean build\n\nxcodebuild -target \"${TARGET_NAME}\" ONLY_ACTIVE_ARCH=NO -configuration ${CONFIGURATION} -sdk iphonesimulator BUILD_DIR=\"${BUILD_DIR}\" BUILD_ROOT=\"${BUILD_ROOT}\" clean build\n\n#拷贝framework到univer目录\n\ncp -R \"${BUILD_DIR}/${CONFIGURATION}-iphonesimulator/${TARGET_NAME}.framework\" \"${UNIVERSAL_OUTPUT_FOLDER}\"\n\nlipo \"${BUILD_DIR}/${CONFIGURATION}-iphonesimulator/${TARGET_NAME}.framework/${TARGET_NAME}\" -remove arm64 -output \"${BUILD_DIR}/${CONFIGURATION}-iphonesimulator/${TARGET_NAME}.framework/${TARGET_NAME}\"\n\n#合并framework，输出最终的framework到build目录\n\n    xcodebuild -create-xcframework -output \"${UNIVERSAL_OUTPUT_FOLDER}/${TARGET_NAME}.xcframework\" -framework \"${BUILD_DIR}/${CONFIGURATION}-iphonesimulator/${TARGET_NAME}.framework\" -framework \"${BUILD_DIR}/${CONFIGURATION}-iphoneos/${TARGET_NAME}.framework\"\n\n#删除编译之后生成的无关的配置文件\n\ndir_path=\"${UNIVERSAL_OUTPUT_FOLDER}/${TARGET_NAME}.framework/\"\n\nfor file in ls $dir_path\n\ndo\n\nif [[ ${file} =~ \".xcconfig\" ]]\n\nthen\n\nrm -f \"${dir_path}/${file}\"\n\nfi\n\ndone\n\n#判断build文件夹是否存在，存在则删除\n\nif [ -d \"${SRCROOT}/build\" ]\n\nthen\n\nrm -rf \"${SRCROOT}/build\"\n\nfi\n\nrm -rf \"${BUILD_DIR}/${CONFIGURATION}-iphonesimulator\" \"${BUILD_DIR}/${CONFIGURATION}-iphoneos\"\n\n#打开合并后的文件夹\n\nopen \"${UNIVERSAL_OUTPUT_FOLDER}\"\n\n\n\n";
